import React from 'react';
import { useSelector } from 'react-redux';
import styled from 'styled-components';

import Card from './Card.js'

export default function Cards() {
  const { cards, currentPage } = useSelector((state) => state);

  return (
      <Div> 
        { 
          cards && cards.slice(currentPage*9, (currentPage + 1)*9).map(card => {
            return ( 
              <Card 
                key= { card.id }
                id={ card.id }
                title={ card.title }
                image={ card.image }
                dishTypes={ card.dishTypes }
                diets={ card.diets }
                score={ card.score }
              /> 
            )
          })
        }
      </Div> 
  )
};

const Div = styled.div`
  position: absolute;
  top: 60px;
  bottom: 0px;
  left: 300px;
  right: 0px;

  width: 2000px;
  display: flex;
  justify-content: center;
  align-items: center;

  font-size: 25px;
  background-color: yellow;
`;
